    };
  },
  mounted() {
    this.init();
    window.addEventListener('resize', () => {
      this.init();
    });
  },
  methods: {
    init() {
      const {width, height} = this.getBox();
      this.width = width;
      this.height = height;
    },
    getBox() {
      const dom = this.$refs[this.ref];
      return {
        width: dom.offsetWidth,
        height: dom.offsetHeight
      };
    }
  }
